tape("geoScaleBar() has the expected defaults", function(test) {
  var s = d3.geoScaleBar();
  test.equal(s.milesRadius(), 3959);
  test.equal(s.kilometersRadius(), 6371);
  test.equal(s.height(), 4);
  test.equal(s.left(), 0);
  test.equal(s.top(), 0);
  test.end();
});

tape("scaleBar.extent(extent) sets the extent explicitly", function(test) {
  var s = d3.geoScaleBar().extent([100, 100]);
  test.deepEqual(s.extent(), [100, 100]);
  test.end();
});

